// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;  // 0.8.21  0.8.19 

contract AdContract {
    struct Ad {
        address advertiser;     //   
        uint256 reward;         // 
        uint256 maxInfluencer;  //   
        uint256 deadline;       //    timestamp
        bytes32 metadataHash;   //     
        uint256 acceptedCount;  //  
        bool isClosed;
    }

    struct Influencer {
        address influencer;
        bool paid;
        uint256 joinTime;
    }

    mapping(uint256 => Ad) public ads;
    mapping(uint256 => mapping(address => Influencer)) public adInfluencerMap;

    uint256 public nextAdId;

    //  
    event AdCreated(uint256 indexed adId, address indexed advertiser, uint256 reward);
    event DepositSuccess(address indexed user, uint256 amount);
    event JoinedAd(uint256 indexed adId, address indexed influencer);
    event PaidInfluencer(uint256 indexed adId, address indexed influencer, uint256 reward);

    constructor() {
        nextAdId = 0;
    }

    // () 
    function deposit() public payable {
        require(msg.value > 0, "Amount must be greater than 0");
        emit DepositSuccess(msg.sender, msg.value);
    }

    //    (addContract)
    function addContract(
        uint256 reward,
        uint256 maxInfluencer,
        uint256 deadline,
        bytes32 metadataHash
    ) public payable { // 
        require(msg.value >= reward, "Insufficient payment");
        require(reward > 0, "Reward must be greater than 0");
        require(maxInfluencer > 0, "Max influencer must be greater than 0");
        require(deadline > block.timestamp, "Deadline must be in the future");

        // 
        ads[nextAdId] = Ad({
            advertiser: msg.sender,
            reward: reward,
            maxInfluencer: maxInfluencer,
            deadline: deadline,
            metadataHash: metadataHash,
            acceptedCount: 0,
            isClosed: false
        });

        emit AdCreated(nextAdId, msg.sender, reward);
        nextAdId++;
    }

    //  join
    function joinAd(uint256 adId) public {
        require(adId < nextAdId, "Invalid adId");

        Ad storage ad = ads[adId];

        require(!ad.isClosed, "Ad is closed");
        require(ad.acceptedCount < ad.maxInfluencer, "Max influencers reached");
        require(ad.deadline > block.timestamp, "Deadline passed");
        require(adInfluencerMap[adId][msg.sender].influencer == address(0), "Already joined");

        adInfluencerMap[adId][msg.sender] = Influencer({
            influencer: msg.sender,
            paid: false,
            joinTime: block.timestamp
        });

        ad.acceptedCount++;
        emit JoinedAd(adId, msg.sender);
    }

    // ( gpt  )
    function payInfluencer(uint256 adId, address influencer) public {
        Ad storage ad = ads[adId];
        Influencer storage inf = adInfluencerMap[adId][influencer];

        require(inf.influencer != address(0), "Not joined"); //    
        require(!inf.paid, "Already paid"); //   
        require(address(this).balance >= ad.reward, "Insufficient balance"); //  

        inf.paid = true;
        payable(influencer).transfer(ad.reward); //   

        emit PaidInfluencer(adId, influencer, ad.reward);
    }

    //     
    function getInfluencerInfo(uint256 adId, address influencer) public view returns (address, bool, uint256) {
        Influencer memory inf = adInfluencerMap[adId][influencer];
        return (inf.influencer, inf.paid, inf.joinTime);
    }

    //   
    function getAd(uint256 adId) public view returns (Ad memory) {
        return ads[adId];
    }

    //   
    function getBalance() public view returns (uint256) {
        return address(this).balance;
    }
}
